import React from 'react';
import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';
import HomeScreen from "../../Media/HomeScreen.JPG";


const HomeBanner = () => {

    return (
        <div>

            <AwesomeSlider>
                <div>1</div>
                <div>2</div>
                <div>3</div>
                <div>4</div>
            </AwesomeSlider>

        </div>
    )
}


export default HomeBanner;
